import React, { useEffect, useState } from 'react';
import axios from 'axios';

function SlotList() {
  const [slots, setSlots] = useState([]);

  useEffect(() => {
    axios.get('http://localhost:8080/api/slots') // Ä‘á»•i theo API backend báº¡n
      .then(res => setSlots(res.data))
      .catch(err => console.error(err));
  }, []);

  return (
    <div className="bg-white p-4 rounded shadow">
      <h2 className="text-xl font-semibold mb-2">Parking Slots</h2>
      <ul className="space-y-2">
        {slots.map(slot => (
          <li key={slot.id} className="p-2 border rounded bg-green-100">
            Block: {slot.block?.name || slot.block} | Floor: {slot.floor} | 
            {slot.occupied ? ' ðŸš« Occupied' : ' âœ… Available'}
          </li>
        ))}
      </ul>
    </div>
  );
}

export default SlotList;
